import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';



export default function Header() {
  return (
    <Box sx={{ width: '100%' }}>
      <Grid container spacing={3}>
        <Grid item xs>
            <Item>xs</Item>
        </Grid>
        <Grid item xs={6}>
            <Item>xs=6</Item>
        </Grid>
        <Grid item xs>
            <Item>xs</Item>
        </Grid>
        </Grid>
    </Box>
  );
}
